class MyIterator:
    def __init__(self, *args):
        self.index = 0
        self.args = args

    def __iter__(self):
        return self

    def __next__(self):
        try:
            result = self.args[self.index]
        except IndexError:
            raise StopIteration
        self.index += 1
        return result

